impl Solution {
    pub fn min_operations(nums1: Vec<i32>, nums2: Vec<i32>) -> i32 {
        let n = nums1.len();
        let mut max_num1 = nums1[0];
        let mut max_num2 = nums2[0];
        let mut swap_needed = 0;

        // Find the maximum value in both arrays
        for i in 0..n {
            if nums1[i] > max_num1 {
                max_num1 = nums1[i];
            }
            if nums2[i] > max_num2 {
                max_num2 = nums2[i];
            }
        }

        // Check if swapping is needed to make nums1[n-1] and nums2[n-1] the maximum values
        for i in 0..n {
            if nums1[i] == max_num1 && nums2[i] != max_num2 {
                swap_needed += 1;
                break;
            }
            if nums2[i] == max_num2 && nums1[i] != max_num1 {
                swap_needed += 1;
                break;
            }
        }

        // Check final conditions
        if nums1[n-1] != max_num1 && nums2[n-1] != max_num2 {
            return -1; // Impossible to satisfy both conditions
        }
        if nums1[n-1] != max_num1 || nums2[n-1] != max_num2 {
            swap_needed = 1;
        }

        swap_needed
    }
}
